Calculation.Text:
Substitute(List(
  "rake run DEBUG=1 PASSWORD=" & Quote(password);
  If(not IsEmpty(rounds); "ROUND=" & Quote(rounds));
  Case(
    Exact(salt; "Char(26)"); "SALT=" & Quote("");
    not IsEmpty(salt); "SALT=" & Quote(Evaluate(salt)));
); ¶; " ")

// AsciiFilter(textToFilter)
// Returns text filtered only to symbols / alphanumeric characters available in ASCII
// However, invisible characters (00-19, 7F) excluding SPACE such as TAB, DEL, CR, and LD are not included.
//
// ver 0.1
// LastUpdate: 2019/12/05
// Compatible: FileMaker Pro 7 and later
//
// Params:
//   textToFilter: [Text]
//
// Result: [Text]
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Filter(
  textToFilter;
   " !\"#$%&'()*+,-./"
  & "0123456789:;<=>?"
  & "@ABCDEFGHIJKLMNO"
  & "PQRSTUVWXYZ[\]^_"
  & "`abcdefghijklmno"
  & "pqrstuvwxyz{|}~"
)

// PasswordHash_Round(roundNumber; index; digestAlgorithm; inputHex; convertedSaltHex; convertedPasswordHex)
// Perform PasswordHash stretching process
//
// Result: [Object] CryptDigest
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Let([
  ~cHex = If(Mod(index; 2); convertedPasswordHex; inputHex);
  ~cHex = If(not Mod(index; 3) = 0; ~cHex & convertedSaltHex; ~cHex);
  ~cHex = If(not Mod(index; 7) = 0; ~cHex & convertedPasswordHex; ~cHex);
  ~cHex = If(Mod(index; 2); ~cHex & inputHex; ~cHex & convertedPasswordHex);
  ~result = CryptDigest(HexDecode(~cHex; True); digestAlgorithm);
  ~resultHex = HexEncode(~result);
  ~nextIndex = index + 1;
_=0];
  Case(
    roundNumber = ~nextIndex;
    ~result;

    roundNumber > index;
    PasswordHash_Round(roundNumber; ~nextIndex; digestAlgorithm; ~resultHex; convertedSaltHex; convertedPasswordHex);

    "?"
  )
)

// PasswordHash(password; salt; rounds)
// Creates a password hash
//
// ver 0.1
// LastUpdate: 2019/12/05
// Compatible: FileMaker Pro 16 and later
//             not supported in runtime solutions
//
// Params:
//   password: [Text] 生のパスワード。8〜64文字、ASCII（不可視文字はスペースのみ）。
//   salt:     [Text] 基本的には空欄、デフォルト値推奨。
//                      空欄の場合16文字（96bit）の乱数を利用する。
//                      salt用の文字列。最大16文字。それを超える場合は17文字以降を削除する。
//                      非推奨だが互換性を保つ為 salt がない場合 `Char(26)` を指定することで、真の意味で空欄扱いになる。
//   rounds:   [Number] 基本的には空欄、デフォルト値推奨。
//                      空欄の場合は5,000回に設定される。
//                      ストレッチング回数。SetRecursionを使わずに利用する場合は 49,900 ぐらいが限度。
//
// Result: [Text] ハッシュ値 or エラー情報
//   正常時:
//     "$6f$/pFNGxeaFY7bSiX4$j8OaSP65.C7JPf3lYCqHUbXyTH9C2qSPfBuwlHzqojf8ZtvdPbUEczVesUBY4Htq4ppxhkKoLv09qKsszNwKmQ"
//   エラー時（ストレッチング回数が限界を超えているなど）:
//     "?"
//   エラー salt に利用できない文字が含まれている時:
//     "?:Character that cannot be used for salt"
//   エラー password に利用できない文字が含まれている時:
//     "?:Character that cannot be used for password"
//   エラー rounds に自然数以外が指定されている場合
//     "?:rounds is incorrect as a number"
//   エラー password が8文字未満の場合
//     "?:password is too short";
//   エラー password が64文字を超える場合
//     "?:Password too long";
//
// Example:
//   デフォルト値を利用して "Password" をハッシュ化:
//     PasswordHash("Password"; ""; "")
//   Salt を指定した例:
//     PasswordHash("Password"; "/pFNGxeaFY7bSiX4"; "")
//   5万回を超えるストレッチングを行う例（FileMaker 18以上必須）:
//     SetRecursion(PasswordHash("Password"; ""; 60000); 60100)
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Case(
  // Validation
  not Exact(salt; Char(26)) and not Exact(AsciiFilter(salt); salt); "?:Character that cannot be used for Salt";
  not Exact(AsciiFilter(password); password); "?:Character that cannot be used for Password";
  Length(password) < 8 ; "?:Password is too short";
  Length(password) > 64 ; "?:Password too long";
  not Exact(Abs(Int(rounds)); rounds); "?:Rounds is incorrect as a number";

  Let([
    // Default values
    ~default_salt_length = 16;
    ~max_salt_length     = 16;
    ~default_rounds      = 5000;
    ~digestAlgorithm     = "SHA512";
    ~algorithmByteLength = 64;
    ~identifier          = "6f"; // MCF(Modular Crypt Format) identifier 6 = SHA256, F = FileMaker

    // 文字列複製用のドット Substitute で文字列のリピートを再現 (MAX 256)
    ~repeatBase = "...................................................................................................."
                & "...................................................................................................."
                & "........................................................";

    // Argument optimization
    ~salt = Case(
      Exact(salt; Char(26)); "";
      not IsEmpty(salt); Left(salt; 16);
      PasswordSaltGenerate(16)
    );
    ~roundNumber = GetAsNumber(rounds);
    ~roundNumber = Case(
      IsEmpty(~roundNumber); ~default_rounds;
      ~roundNumber < 1000; 1000;
      ~roundNumber > 999999999; 999999999;
      ~roundNumber
    );

    // Argument info
    ~passwordLength = Length(password);
    ~passwordHex = HexEncode(password);
    ~saltLength = Length(~salt);

    ~b = CryptDigest(password & ~salt & password; ~digestAlgorithm);
    ~bHex = HexEncode(~b);

    ~bRepeatHex = If(Int(~passwordLength / ~algorithmByteLength) = 1; ~bHex; "");
    ~bFrontHex = Left(~bHex; Mod(~passwordLength; ~algorithmByteLength) * 2);
    ~aStringHex = ~passwordHex & HexEncode(~salt) & ~bRepeatHex & ~bFrontHex;

    ~repeatBitList = List("pppb"; "bppb"; "pbpb"; "bbpb"; "ppbb"; "bpbb"; "pbbb"; "bbbb"; "ppppb"; "bpppb"; "pbppb"; "bbppb";
      "ppbpb"; "bpbpb"; "pbbpb"; "bbbpb"; "pppbb"; "bppbb"; "pbpbb"; "bbpbb"; "ppbbb"; "bpbbb"; "pbbbb"; "bbbbb"; "pppppb";
      "bppppb"; "pbpppb"; "bbpppb"; "ppbppb"; "bpbppb"; "pbbppb"; "bbbppb"; "pppbpb"; "bppbpb"; "pbpbpb"; "bbpbpb"; "ppbbpb";
      "bpbbpb"; "pbbbpb"; "bbbbpb"; "ppppbb"; "bpppbb"; "pbppbb"; "bbppbb"; "ppbpbb"; "bpbpbb"; "pbbpbb"; "bbbpbb"; "pppbbb";
      "bppbbb"; "pbpbbb"; "bbpbbb"; "ppbbbb"; "bpbbbb"; "pbbbbb"; "bbbbbb"; "ppppppb");
    ~aStringHex = ~aStringHex & Substitute(GetValue(~repeatBitList; ~passwordLength - 7); ["p"; ~passwordHex]; ["b"; ~bHex]);
    ~aString = HexDecode(~aStringHex; True);

    ~input = CryptDigest(~aString; ~digestAlgorithm);
    ~inputHex = HexEncode(~input);

    ~dp = CryptDigest(Substitute(Left(~repeatBase; ~passwordLength); "."; password); ~digestAlgorithm);
    ~dpHex = HexEncode(~dp);

    ~pHexFront = Substitute(Left(~repeatBase; Int(~passwordLength / ~algorithmByteLength)); "."; ~dpHex);
    ~pHexBack = Left(~dpHex; Mod(~passwordLength; ~algorithmByteLength) * 2);
    ~pHex = ~pHexFront & ~pHexBack;

    ~inputFirstByte = Let([
      ~firstByte = Left(~inputHex; 2);
      ~first = Left(~firstByte; 1);
      ~first = Substitute(~first; ["A"; 10]; ["A"; 10]; ["B"; 11]; ["C"; 12]; ["D"; 13]; ["E"; 14]; ["F"; 15]);
      ~last = Right(~firstByte; 1);
      ~last = Substitute(~last; ["A"; 10]; ["A"; 10]; ["B"; 11]; ["C"; 12]; ["D"; 13]; ["E"; 14]; ["F"; 15]);
    _=0];
      ~last + (~first * 16)
    );
    ~repeatedSalt = Substitute(Left(~repeatBase; (16 + ~inputFirstByte)); "."; ~salt);
    ~ds = CryptDigest(~repeatedSalt; ~digestAlgorithm);
    ~dsHex = HexEncode(CryptDigest(~repeatedSalt; ~digestAlgorithm));

    ~sHex = Substitute(Left(~repeatBase; Int(~saltLength / ~algorithmByteLength)); "."; ~dsHex)
            & Left(~dsHex; Mod(~saltLength; ~algorithmByteLength) * 2);
    ~s = HexDecode(~sHex; True);

    ~input = PasswordHash_Round(~roundNumber; 0; ~digestAlgorithm; ~inputHex; ~sHex; ~pHex);

    ~digest = Substitute(Base64EncodeRFC(4648; CryptDigest(~input; "SHA512")); ["+"; "."]; ["="; ""]);
    ~rounds = If(~roundNumber <> 5000; "$rounds=" & ~roundNumber);

    ~result = "$" & ~identifier & ~rounds & "$" & ~salt & "$" & ~digest;
  _=0];
    ~result
  )
)

// PasswordHash_DEBUG(password; salt; rounds)
//
// === 通常使用禁止 ===
//
// PasswordHash の開発用関数
// 経過途中の変数をログとして出力することで、Rubyのプログラムと比較しやすくする為に作成
// 脆弱な値を出力しまくるので、通常開発用途以外での使用は行わない。
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Case(
  // Validation
  not Exact(salt; Char(26)) and not Exact(AsciiFilter(salt); salt); "?:Character that cannot be used for Salt";
  not Exact(AsciiFilter(password); password); "?:Character that cannot be used for Password";
  Length(password) < 8 ; "?:Password is too short";
  Length(password) > 64 ; "?:Password too long";
  not Exact(Abs(Int(rounds)); rounds); "?:Rounds is incorrect as a number";

  Let([
~log = "";

    // Default values
    ~default_salt_length = 16;
    ~max_salt_length     = 16;
    ~default_rounds      = 5000;
    ~digestAlgorithm     = "SHA512";
    ~algorithmByteLength = 64;
    ~identifier          = "6f"; // MCF(Modular Crypt Format) identifier 6 = SHA256, F = FileMaker

    // 文字列複製用のドット Substitute で文字列のリピートを再現 (MAX 256)
    ~repeatBase = "...................................................................................................."
                & "...................................................................................................."
                & "........................................................";

    // Argument optimization
    ~salt = Case(
      Exact(salt; Char(26)); "";
      not IsEmpty(salt); Left(salt; 16);
      PasswordSaltGenerate(16)
    );
    ~roundNumber = GetAsNumber(rounds);
    ~roundNumber = Case(
      IsEmpty(~roundNumber); ~default_rounds;
      ~roundNumber < 1000; 1000;
      ~roundNumber > 999999999; 999999999;
      ~roundNumber
    );
~log = List(~log; "SET ~roundNumber: " & ~roundNumber);

    // Argument info
    ~passwordLength = Length(password);
    ~passwordHex = HexEncode(password);
    ~saltLength = Length(~salt);

    ~b = CryptDigest(password & ~salt & password; ~digestAlgorithm);
    ~bHex = HexEncode(~b);
~log = List(~log; "SET ~b (MD5):" & GetContainerAttribute(~b; "MD5"));

    ~bRepeatHex = If(Int(~passwordLength / ~algorithmByteLength) = 1; ~bHex; "");
    ~bFrontHex = Left(~bHex; Mod(~passwordLength; ~algorithmByteLength) * 2);
    ~aStringHex = ~passwordHex & HexEncode(~salt) & ~bRepeatHex & ~bFrontHex;
~log = List(~log; "SET ~aString (MD5):" & GetContainerAttribute(HexDecode(~aStringHex; True); "MD5"));

    ~repeatBitList = List("pppb"; "bppb"; "pbpb"; "bbpb"; "ppbb"; "bpbb"; "pbbb"; "bbbb"; "ppppb"; "bpppb"; "pbppb"; "bbppb";
      "ppbpb"; "bpbpb"; "pbbpb"; "bbbpb"; "pppbb"; "bppbb"; "pbpbb"; "bbpbb"; "ppbbb"; "bpbbb"; "pbbbb"; "bbbbb"; "pppppb";
      "bppppb"; "pbpppb"; "bbpppb"; "ppbppb"; "bpbppb"; "pbbppb"; "bbbppb"; "pppbpb"; "bppbpb"; "pbpbpb"; "bbpbpb"; "ppbbpb";
      "bpbbpb"; "pbbbpb"; "bbbbpb"; "ppppbb"; "bpppbb"; "pbppbb"; "bbppbb"; "ppbpbb"; "bpbpbb"; "pbbpbb"; "bbbpbb"; "pppbbb";
      "bppbbb"; "pbpbbb"; "bbpbbb"; "ppbbbb"; "bpbbbb"; "pbbbbb"; "bbbbbb"; "ppppppb");
    ~aStringHex = ~aStringHex & Substitute(GetValue(~repeatBitList; ~passwordLength - 7); ["p"; ~passwordHex]; ["b"; ~bHex]);
    ~aString = HexDecode(~aStringHex; True);
~log = List(~log; "SET ~aString (MD5):" & GetContainerAttribute(~aString; "MD5"));

    ~input = CryptDigest(~aString; ~digestAlgorithm);
    ~inputHex = HexEncode(~input);
~log = List(~log; "SET ~input (MD5):" & GetContainerAttribute(~input; "MD5"));

    ~dp = CryptDigest(Substitute(Left(~repeatBase; ~passwordLength); "."; password); ~digestAlgorithm);
    ~dpHex = HexEncode(~dp);
~log = List(~log; "SET ~dp (MD5):" & GetContainerAttribute(~dp; "MD5"));

    ~pHexFront = Substitute(Left(~repeatBase; Int(~passwordLength / ~algorithmByteLength)); "."; ~dpHex);
    ~pHexBack = Left(~dpHex; Mod(~passwordLength; ~algorithmByteLength) * 2);
    ~pHex = ~pHexFront & ~pHexBack;
~p = HexDecode(~pHex; True);
~log = List(~log; "SET ~p (MD5):" & GetContainerAttribute(~p; "MD5"));

    ~inputFirstByte = Let([
      ~firstByte = Left(~inputHex; 2);
      ~first = Left(~firstByte; 1);
      ~first = Substitute(~first; ["A"; 10]; ["A"; 10]; ["B"; 11]; ["C"; 12]; ["D"; 13]; ["E"; 14]; ["F"; 15]);
      ~last = Right(~firstByte; 1);
      ~last = Substitute(~last; ["A"; 10]; ["A"; 10]; ["B"; 11]; ["C"; 12]; ["D"; 13]; ["E"; 14]; ["F"; 15]);
    _=0];
      ~last + (~first * 16)
    );
    ~repeatedSalt = Substitute(Left(~repeatBase; (16 + ~inputFirstByte)); "."; ~salt);
    ~ds = CryptDigest(~repeatedSalt; ~digestAlgorithm);
    ~dsHex = HexEncode(CryptDigest(~repeatedSalt; ~digestAlgorithm));
~log = List(~log; "SET ~ds (MD5):" & GetContainerAttribute(~ds; "MD5"));

    ~sHex = Substitute(Left(~repeatBase; Int(~saltLength / ~algorithmByteLength)); "."; ~dsHex)
            & Left(~dsHex; Mod(~saltLength; ~algorithmByteLength) * 2);
    ~s = HexDecode(~sHex; True);
~log = List(~log; "SET ~s (MD5):" & GetContainerAttribute(~s; "MD5"));

    ~input = PasswordHash_Round(~roundNumber; 0; ~digestAlgorithm; ~inputHex; ~sHex; ~pHex);
~log = List(~log; "SET ~input (MD5):" & GetContainerAttribute(~input; "MD5"));

    ~digest = Substitute(Base64EncodeRFC(4648; CryptDigest(~input; "SHA512")); ["+"; "."]; ["="; ""]);
    ~rounds = If(~roundNumber <> 5000; "$rounds=" & ~roundNumber);

    ~result = "$" & ~identifier & ~rounds & "$" & ~salt & "$" & ~digest;
  _=0];
    List(~log; ~result)
  )
)

// PasswordSaltGenerate(numberOfCharacters)
// Creates a Bese64Encoded pseudo-random with an upper limit of 20 characters
//
// ver 0.1
// LastUpdate: 2019/12/05
// Compatible: FileMaker Pro 13 and later
//
// Params:
//   numberOfCharacters: [Number] 文字数。最大20。
//
// Result: [Text] Base64Encodeを基にした文字列（"+" 記号は "." に置き換えられ、"="は削除されます）
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Let([
  ~num = GetAsNumber(numberOfCharacters);
  ~uuid = Substitute(Get(UUID); "-"; "");
  ~hex30 = Left(~uuid; 12) & Middle(~uuid; 14; 3) & Right(~uuid; 15);
_=0];
  Left(Substitute(Base64Encode(HexDecode(~hex30; True)); ["+"; "."]; ["="; ""]); ~num)
)

// PasswordVerify(password; hash)
// Verifies that a password matches a hash
//
// ver 0.1
// LastUpdate: 2019/12/05
// Compatible: FileMaker Pro 16 and later
//             not supported in runtime solutions
//
// Params:
//   password: [Text] 生のパスワード
//   hash:     [Text] PasswordHash で作られた Hash値
//
// Result: [Number, Text] True(1), False(0), "?"
//   認証成功時（一致）: True
//   認証失敗時（不一致）: False
//   エラー時（hashの形式を誤っている、ストレッチング回数が限界を超えているなど）: "?"
//
// Example:
//   認証を検証する場合:
//     $hash = "$6f$/pFNGxeaFY7bSiX4$j8OaSP65.C7JPf3lYCqHUbXyTH9C2qSPfBuwlHzqojf8ZtvdPbUEczVesUBY4Htq4ppxhkKoLv09qKsszNwKmQ";
//     Exact(PasswordVerify("Password"; $hash); True)
//   5万回を超えるストレッチングを検証する場合（FileMaker 18以上必須）:
//     $hash "$6f$rounds=60000$7HM2jvfdM9/gYvKj$OHXOzqBUI2bw.xCjFMf1tl1WudWsBRwUYrBEp8bUG651ciJDhOeIP0cnREwjul9KFvOnxj0pH6lgYXYpSkTC6w";
//     SetRecursion(Exact(PasswordVerify("Password"; $hash); True); 60100)
//
// Licensed under the BSD license. See https://github.com/hazi/FileMaker-PasswordHash/blob/master/LICENSE
Let([
  ~separator = "$";
  ~hash = hash;

  ~identifierEndPosition = Position(hash; ~separator; 2; 1);
  ~identifier = Middle(hash; 2; ~identifierEndPosition - 2);
  ~hash = Middle(~hash; ~identifierEndPosition + 1; Length(~hash));

  ~roundsKeyword = "rounds=";
  ~nextSeparator = Position(~hash; ~separator; 1; 1);
  ~rounds = If(
    Left(~hash; Length(~roundsKeyword)); ~roundsKeyword;
    Middle(~hash; Length(~roundsKeyword) + 1; ~nextSeparator - Length(~roundsKeyword) - 1)
  );
  ~rounds = If(Exact(~rounds; GetAsNumber(~rounds)); GetAsNumber(~rounds));
  ~hash = If(not IsEmpty(~rounds); Middle(~hash; ~nextSeparator + 1; Length(~hash)); ~hash);

  ~lastSeparator = Position(~hash; ~separator; Length(~hash); -1);
  ~salt = Middle(~hash; 1; ~lastSeparator - 1);
  ~salt = If(IsEmpty(~salt); Char(26); ~salt);

  ~result = PasswordHash(password; ~salt; ~rounds);
_=0];
  Case(
    ~rounds > 999999999
    or ~identifier <> "6f"
    or Length(~salt) > 100;
    "?";

    Exact(~result; hash)
  )
)

